//stranica za prikaz broja kupca koji je trenutno na redu
import { useParams } from "react-router-dom";
import './printstyle.css';


export default function PrintNumber() {

    const {num} = useParams();
   
    return (
       
    <div class ="container">

        <div class="ticket">
            
            <img src="http://10.0.9.243/nadja/public/logo-gray.png" alt="Logo"/>
            <p class="centered">Vaš broj je:</p>
            <h1 class="number">{num}</h1>
            <p class="centered">Hvala što kupujete u Univerexportu</p>
            <br/>
        </div>

    </div>


    )
}
